function App() {
    return (
        <div className="App">
            <NavigationBar />
            <div className="main">
                <Carousel showArrows={true}>
                    <div>
                        <img src={carouselImage1} alt="Carousel 1" />
                    </div>
                    <div>
                        <img src={carouselImage2} alt="Carousel 2" />
                    </div>
                    <div>
                        <img src={carouselImage3} alt="Carousel 3" />
                    </div>
                </Carousel>
            </div>
            <Footer />
        </div>
    );
}

export default App;
